import React, { Component } from 'react';
import { ButtonDropdown, DropdownToggle, DropdownMenu, DropdownItem } from 'reactstrap';
import {Link} from "react-router-dom";
import { Nav, NavLink } from 'reactstrap';

import "../App.css";

class Navbar extends Component {
  constructor(props) {
    super(props);
    this.state = {

    };
  }

  render() {
    return (
      <div>
        <Nav className="NavBarLarge" >
            <NavLink tag={Link} to={'/'} className="d-flex Nav-text NavOptions">Home</NavLink>
            <NavLink tag={Link} to={'/Services'} className="d-flex Nav-text NavOptions">Services</NavLink>
            <NavLink tag={Link} to={'/AboutUs'} className="d-flex Nav-text NavOptions">About Us</NavLink>
            <NavLink tag={Link} to={'/Portfolio'} className="d-flex Nav-text NavOptions">Portfolio</NavLink>
            <NavLink tag={Link} to={'/ContactUs'} className="d-flex Nav-text NavOptions">Contact Us</NavLink>
          </Nav>
      </div>
    );
  }
}

export default Navbar;
